  const { id } = useParams();
  const [edited, setEdited] = useState({});

  const traerData = () => {
    Axios.get(`/users/api/vaults/${id}`)
      .then(res => { 
        setEdited(res.data)
      }
      )
      .catch(err => {
        console.log(err)
      }
      )
  }
  useEffect(() => {
    traerData();
  }, []);

